import './Informacoes.css'

function eae(conteudo) {
    var resultado
    for(var i in conteudo){
    resultado += i;
    }
return resultado
}

function Informacoes(props){
    
    return(
        <div>
            <h1>{eae(props)}</h1>
        </div>
    )
}
export default Informacoes;
